import React from "react";
import { Link } from 'react-router-dom';
import { Table } from "antd";
import constable1 from "../pdf/ssc/constable/2021_shift1.pdf"
import constable2 from "../pdf/ssc/constable/2021_shift2.pdf"
import constable3 from "../pdf/ssc/constable/2021_shift3.pdf"
import constable4 from "../pdf/ssc/constable/2021_shift4.pdf"


function SSC() {
  const dataSource = [
    {
      key: "1",
      name: "Constable",
      year:"2021",
      batch:"1",
      address: (
        <a href={constable1} target="_blank">
          Download
        </a>
      ),
    },
    {
      key: "2",
      name: "Constable",
      year:"2021",
      batch:"2",
      address: (
        <a href={constable2} target="_blank">
          Download
        </a>
      ),
    },
    {
      key: "3",
      name: "Constable",
      year:"2021",
      batch:"3",
      address: (
        <a href={constable3} target="_blank">
          Download
        </a>
      ),
    },
    {
      key: "4",
      name: "Constable",
      year:"2021",
      batch:"4",
      address: (
        <a href={constable4} target="_blank">
          Download
        </a>
      ),
    },
  ];

  const columns = [
    {
      title: "DEPT",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "YEAR",
      dataIndex: "year",
      key: "year",
    },
    {
      title: "Batch",
      dataIndex: "batch",
      key: "batch",
    },
    {
      title: "LINK",
      dataIndex: "address",
      key: "address",
    },
  ];

  const dataSource1 = [
    {
      key: "1",
      name: "SSC - Staff Selection Commission",
      address: <Link to="/ssc">Link</Link>,
    },
    {
      key: "2",
      name: "RRB - Indian Railway",
      address: <Link to="/rrb">Link</Link>,
    },
    {
      key: "3",
      name: "IBPS",
      address: <Link to="/ibps">Link</Link>,
    },
    {
      key: "4",
      name: "UPSC CMS",
      address: <Link to="/upsc-cms">Link</Link>,
    },
    {
      key: "5",
      name: "NEET PG",
      address: <Link to="/neet-pg">Link</Link>,
    },
    {
      key: "6",
      name: "UPSC All",
      address: <Link to="/neet-pg">Link</Link>,
    },
    {
      key: "7",
      name: "INDIAN ARMY",
      address: <Link to="/neet-pg">Link</Link>,
    },
    {
      key: "8",
      name: "DRDO",
      address: <Link to="/neet-pg">Link</Link>,
    },
    {
      key: "9",
      name: "SBI (State Bank of India )",
      address: <Link to="/neet-pg">Link</Link>,
    },
  ];

  const columns1 = [
    {
      title: "DEPT",
      dataIndex: "name",
      key: "name",
    },
    {
      title: "LINK",
      dataIndex: "address",
      key: "address",
    },
  ];
  return (
    <>
      <h1>SSC - Staff Selection Commission Question and Answers</h1>
      <div>
      <h2>Constable Previous Year Question Papers</h2>
      <Table dataSource={dataSource} columns={columns} />
      <h2>Sub-Inspector Previous Year Question Papers</h2>
      <Table dataSource={dataSource1} columns={columns1} />
      </div>
    </>
  );
}

export default SSC;
